import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import './components/styles.css';
import Home from './components/Home';
import AdoptableDog from './components/Rescue/AdoptableDogs';
import AdoptableCat from './components/Rescue/AdoptableCats';
import About from './components/About/about';

export default function App() {
  return (
    <Router>
    <div>
    <Switch>
    <Route path="/about">
      <AboutUsPage/>
</Route>
      <Route path="/adoptabledogs">
      <AdoptableDogPage/>

      </Route>
      <Route path="/adoptablecats">
      <AdoptableCatPage/>

      </Route>
      <Route path='/'>
        <Home/>

      </Route>
    </Switch>
    </div>
    </Router>
  );
}


function AdoptableDogPage() {
  return (
    <div>
    <AdoptableDog/>
    </div>
    )
}

function AdoptableCatPage(){
  return (
    <AdoptableCat/>
  )
}

function AboutUsPage(){
  return (
    <About/>
  )
}
